import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class Main extends React.Component{

    componentDidMount(){
      this.loadData();
    }

    loadData = () => {
      this.setState({
        list: [
          'Banana',
          'Maçã',
          'Laranja',
          'Pêra'
        ]
      })
    }

    render(){
      return(
        <div>
          <h1>OIIIIIIIIIAFD</h1>
          <ul>
            {this.state.list.map(item => <li>{item}</li>)}
          </ul>
        </div>
      )
    }
}

ReactDOM.render(
  <Main />,
  document.getElementById('root')
);
